import React from 'react';
import {useState, useEffect} from 'react';
import axios from 'axios';



const App = () => {

const [gigs, setGigs] = useState([]);

useEffect(() => {
    axios
      .get('http://localhost:8080')
      .then((response) => {
        setGigs(response.data)
        })
  }, []);



  return (
    <div className="home">
      <h1>Testing</h1>
    </div>
  );
}

export default App;
